import React from "react";
import "./style/SalesDashboard.css";
import { AiOutlineDown } from 'react-icons/ai';
import { BsThreeDots } from 'react-icons/bs';

export default function SalesDashboard() {
    return (
        <>

            <div className="Salesdashboard">
                <div className="Salesdashboard_1">
                    <div className="Salesdashboard_1_title">
                        <AiOutlineDown />
                        <label>TODO</label>
                    </div>
                    <div className="Salesdashboard_1_items">
                        <div className="Salesdashboard_1_items_list"></div>
                        <AiOutlineDown />
                        <div><label>Task names</label></div>
                        <BsThreeDots />
                    </div>
                    <div><label>Campaign</label></div>
                    <div><label>Task</label></div>
                    <div><label>Lead</label></div>


                </div>

                <div className=" Salesdashboard_1_add">
                    <label>+</label>
                </div>
                {/* <div className="Salesdashboard_1"></div> */}
                {/* <div className="Salesdashboard_1"></div> */}
            </div>
        </>


    );
}
